const tokenLogos = {
  'ETH': "data:image/png;base64,",
  'Tether USD': "data:image/png;base64,",
  'USD Coin': "data:image/png;base64,"
}

const tokenDecimals = {
  'ETH': 18,
  'Tether USD': 6,
  'USD Coin': 6
}

const TokenLogo = ({token}) => {
  return (
    <img src={tokenLogos[token]} width={24} height={24}/>
  )
}

const styles = {
  TokenName: {
    'font-weight': 'bold'
  }
}

export const TokenWidget = ({token, value, style}) => {
  return (
    <div className="flex flex-row gap-x-1" style={style || {}}>
      <TokenLogo token={token}/>
      { value ?  `${Number(value) / 10**tokenDecimals[token]} ${token}` : <div style={styles.TokenName}>{token}</div>}
    </div>
  )
}
